import React, { Component } from 'react';
import logo from './logo.svg';
import './Hello.css';

class Hello extends Component {
    render () {
        return (
            <div className="f1 tc">
                <h1>Hellooo World</h1>
                <p>Welcome to React</p>
            </div>
        );
    }
}

export default Hello;
